import { useState, useEffect } from "react";
import axios from "axios";
// import BetsList from "../events/BetsList";

function MyBets(props) {
  const [isLoading, setIsLoading] = useState(false);
  const [loadedBets, setLoadedBets] = useState([]);

  const [user, setUser] = useState(null);

  console.log(props.user);
  console.log("USER ID ", props.user.id);
  console.log("DZET SET ", props.user.bet_set[0]);

  //   useEffect(() => {
  //     setIsLoading(true);

  //     axios({
  //       method: "get",
  //       url: "api/bets/user?userId=" + props.user.id,
  //     }).then((response) => {
  //       let bets = response.data;
  //       let ret = [];
  //       console.log("Bets", bets);
  //       for (let i in bets) {
  //         ret.push(bets[i]);
  //       }
  //       console.log("RET", ret);
  //       setIsLoading(false);
  //       setLoadedBets(ret);
  //     });
  //   }, []); //ako se drugom argumentu promeni stanje onda se opet pozove funkcija

  useEffect(() => {
    (async () => {
      const response = await fetch("http://127.0.0.1:8000/api/user", {
        headers: { "Content-Type": "application/json" },
        credentials: "include",
      });

      const content = await response.json();
      console.log("IDE CONTENT", content);
      setUser(content);
      axios({
        method: "get",
        url: "api/bets/user?userId=" + content.id,
      }).then((response) => {
          console.log("DJE STE VI BRE", response.data)
        let bets = response.data;
        let ret = [];
        console.log("Bets", bets);
        for (let i in bets) {
          ret.push(bets[i]);
        }
        console.log("RET", ret);
        setIsLoading(false);
        setLoadedBets(ret);
      });
    })();
  }, []);


  console.log("to je moj user ", user);

  if (isLoading) {
    return (
      <section>
        <p>Loading...</p>
      </section>
    );
  }

  return (
    <div>
      <h1>Upcoming events</h1>
      {/* <EventList events={loadedEvents} /> */}
    </div>
  );
}

export default MyBets;
